import Link from 'next/link';
import Fade from 'react-reveal/Fade';

const Projects = () =>{
    return(
        <div id="projects">
        <Fade bottom>
            <div className="projects-container">
                <h1>iFavorites</h1>
                <span>App using React-Express-Node and iTunes Search API</span>
                <img src="/static/iTunes.png" className="project-image" />
                <Link href="https://serene-meadow-48919.herokuapp.com/"><i className="fas fa-link"></i></Link>
                <Link href="https://github.com/moralesmiguel/iFavorites"><i className="fab fa-github"></i></Link>
            </div>
        </Fade>
        </div>
    );
}

export default Projects;
